chrome.runtime.onMessage.addListener(function (message, sender, response) {
    if (message.channel === "reported") {
        if (!message.isSafe) {
            insertGoogleFonts();
            document.body.style.display = 'grid';
            document.body.style.placeItems = 'center';
            document.body.style.backgroundColor = '#ffaaaa';
            document.body.style.color = '#001f3f';
            document.body.style.textAlign = 'center';
            document.body.style.height = '100dvh';
            document.body.style.width = '100dvw';
            document.body.style.fontFamily = '"Archivo Black", sans-serif';
            document.body.style.overflow = 'hidden';
            document.body.innerHTML = innerHTML();
        }

        response({ reply: "Message processed" }); // This line is crucial
        return;
    }
});


function insertGoogleFonts() {
    const head = document.head;

    const preconnect1 = document.createElement('link');
    preconnect1.rel = 'preconnect';
    preconnect1.href = 'https://fonts.googleapis.com';
    head.appendChild(preconnect1);

    const preconnect2 = document.createElement('link');
    preconnect2.rel = 'preconnect';
    preconnect2.href = 'https://fonts.gstatic.com';
    preconnect2.crossOrigin = 'anonymous';
    head.appendChild(preconnect2);

    const fontLink = document.createElement('link');
    fontLink.href = 'https://fonts.googleapis.com/css2?family=Archivo+Black&display=swap';
    fontLink.rel = 'stylesheet';
    head.appendChild(fontLink);
}

function innerHTML() {
    return `<div style="max-width: 1200px;">
                <img width="200" height="200" style="margin: 0 auto 20px auto;" src="data:image/png;base64, " alt="Phishshield Logo" />
                <h1 style="font-size: 50px; font-weight: 700; line-height: 1.2; margin-bottom: 10px; color: #001f3f;">
                    WARNING: Malicious Site Detected 
                </h1>
                <p style="font-size: 16px; font-weight: 400; line-height: 1.2; color: #001f3f;">
                    "Access Denied: This website has been flagged as malicious due to potentially harmful activity. For your protection, access to this site has been permanently restricted."
                </p>
            </div>`
}

